How's Christmas in Rishikesh? To be honest I expected it to be completely different, for some reason I romanticised it, I thought it'd be warm and cozy, with very little people and everybody carrying this beautiful Christmas vibration. And if I didn't know what's the date, I couldn't say it's Christmas.
-
Today for the first time I really miss my home, my family, my friends, my city, even my apartment (which is turned to construction site), oh God how I miss my cave, I really feel home there. Even though I only spent 3 weeks home this year.. -
My Friends, I wish you all have a cozy, warm Christmas eve with the ones you love. Treasure what you have here and now, tell your people how much you love them, you never know if there's tomorrow.
-
